def hamming(s1, s2):
  d=0
  for i in range(0, len(s1)):
    if s1[i]!=s2[i]:
      d=d+1
  return d

def apmp(pattern, text, d):
  for i in range(0, len(text)-len(pattern)+1):
    if hamming(text[i:i+len(pattern)], pattern) <= d :
      print(i, end=" ")

apmp("GAGTTCCGATTC","",6)